import React, { useEffect, useState } from 'react';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import styled from 'styled-components';
import { getOfferedApplicationsApi, updateApplicationStatusApi } from '../../../apis/Api';
import Loader from '../../../components/Loader';
import UserNavbar from '../../../components/UserNavbar';

const PageContainer = styled.div`
  padding: 20px;
  background-color: white;
  min-height: calc(100vh - 60px);  // Assuming the navbar is 60px high
`;

const ApplicationsContainer = styled.div`
  max-width: 1600px;
  margin: 0 auto;
  padding: 20px;
  background: white;
  border-radius: 8px;
`;

const ApplicationCard = styled.div`
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  padding: 20px;
  border-bottom: 1px solid #ccc;
  &:last-child {
    border-bottom: none;
  }
  border-radius: 8px;
`;

const ApplicationHeader = styled.div`
  display: flex;
  align-items: center;
  width: 100%;
`;

const ApplicationDetailsContainer = styled.div`
  margin-left: 20px;
`;

const JobTitle = styled.h2`
  font-size: 20px;
  color: #65A168;  // Green color for the job title
  margin: 0;
`;

const EmployerName = styled.p`
  font-size: 16px;
  color: #666;
  margin: 5px 0;
`;

const ButtonContainer = styled.div`
  display: flex;
  gap: 10px;
  margin-top: 10px;
`;

const Button = styled.button`
  background-color: #108A00;
  color: white;
  padding: 10px 20px;
  border: none;
  border-radius: 40px;  // Rounded corners
  cursor: pointer;
  font-size: 16px;
`;

const PaginationContainer = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 20px;
`;

const PageNumber = styled.button`
  background: none;
  border: none;
  padding: 5px 10px;
  cursor: pointer;
  color: #333;
  font-size: 16px;

  &:hover {
    text-decoration: underline;
  }

  &.active {
    font-weight: bold;
    text-decoration: underline;
  }
`;

const OfferedJobsList = () => {
    const [applications, setApplications] = useState([]);
    const [loading, setLoading] = useState(true);
    const [currentPage, setCurrentPage] = useState(1);
    const [totalPages, setTotalPages] = useState(1);

    useEffect(() => {
        fetchApplications(currentPage);
    }, [currentPage]);

    const fetchApplications = async (page) => {
        setLoading(true);
        try {
            const res = await getOfferedApplicationsApi(page);
            setApplications(res.data.applications);
            setTotalPages(res.data.totalPages);
            setLoading(false);
        } catch (error) {
            console.error('Error fetching applications:', error);
            setLoading(false);
        }
    };

    const handleAcceptOffer = async (applicationId) => {
        try {
            await updateApplicationStatusApi({
                applicationId,
                status: 'hired'
            });
            toast.success('Job offer accepted successfully');
            fetchApplications(currentPage);
        } catch (error) {
            console.error('Error accepting job offer:', error);
            toast.error('Error accepting job offer');
        }
    };

    const paginate = (pageNumber) => setCurrentPage(pageNumber);

    return (
        <>
            <UserNavbar />
            <ToastContainer />
            <PageContainer>
                {loading ? (
                    <Loader />
                ) : (
                    <ApplicationsContainer>
                        {applications.map(application => (
                            <ApplicationCard key={application._id}>
                                <ApplicationHeader>
                                    <ApplicationDetailsContainer>
                                        <JobTitle>{application.job.title}</JobTitle>
                                        <EmployerName>{application.job.employer.organizationName}</EmployerName>
                                    </ApplicationDetailsContainer>
                                </ApplicationHeader>
                                <ButtonContainer>
                                    <Button onClick={() => handleAcceptOffer(application._id)}>Accept Offer</Button>
                                </ButtonContainer>
                            </ApplicationCard>
                        ))}
                    </ApplicationsContainer>
                )}
                <PaginationContainer>
                    {[...Array(totalPages).keys()].map(number => (
                        <PageNumber
                            key={number + 1}
                            onClick={() => paginate(number + 1)}
                            className={currentPage === number + 1 ? 'active' : ''}
                        >
                            {number + 1}
                        </PageNumber>
                    ))}
                </PaginationContainer>
            </PageContainer>
        </>
    );
};

export default OfferedJobsList;
